import { useState, useEffect } from 'react';
const Fetch = () => {
  const [quiz, setQuiz] = useState([]);
  useEffect(() => {

    const formData = new FormData();
    formData.append('text', 'this is a test');
    formData.append('username', 'this is a user');
    formData.append('password', 'this is a pasw');



    fetch('http://localhost:3000/', {
        method: 'post',
        body: formData
    })
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setQuiz(data);
      });
  }, []);
  return (
    <div>
      {quiz.map((quiz) => (
        <>
        <p>quiz n: {quiz.id}, contiene {quiz.numeroDomande} domande e dura {quiz.tempoSvolgimento} </p> 
        </>
      ))}
    </div>
  );
};
export default Fetch;
